import { Box, TextField, makeStyles, Button, Typography} from '@material-ui/core'

const useStyles = makeStyles((theme) =>({
    box:{
        textAlign: 'center',
        marginTop:'-140px',
        display:'flex',
        flexDirection: 'column',
        background:'white',
        borderRadius: '10px',
        border:'5px solid #fafafa',
        [theme.breakpoints.down('sm')]: {
            width: '60%',
        },
    },
    title:{
        marginBottom:'20px'
    },
    input:{
        marginBottom: '10px',
    },
}));

const Login = () => {

    const classes = useStyles();

    return (
        <Box className={classes.box} p={5} width="25%">
            <Typography className={classes.title} variant="h4">Login</Typography>
            <TextField id="outlined-basic" label="Email" variant="outlined" className={classes.input}/>
            <TextField id="outlined-basic" label="Password" variant="outlined" className={classes.input}/>
            <Button variant="contained" color="primaryt">Submit</Button>
        </Box>
    )
}

export default Login
